import React from 'react'
import {Avatar, Card} from 'antd';

const UserProfile = () => {
  return (
    <Card
      actions={[
        <div key="">찍찍 </div>
      ]}
    >
      <Card.Meta
        avatar={<Avatar>SH</Avatar>}
        title="SuHwan"
      />
    </Card>
  )
}

export default UserProfile
